import './PokeCard.css';

function PokeCard() {
  
  const pokemon ={
    elementTypes:'water',
    name:'Ronaldo',
    id:27,
    ClassNames:'card' + elementTypes,
    CardSubtitle: 'Plant|Poisonous'
  }
  

  return (
    <li className={['card {elementTypes}']}>
        <img class="card-image "alt ="${name}" src="https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/29.png" />
        <h2 class="card-title"> {pokemon.id}. {pokemon.name}</h2>
        <p class="card-subtitle">{pokemon.CardSubtitle}</p>
    </li>
  );
}

export default PokeCard;
